import React from "react";

function SelectMenuTimeItem(props) {
  let { item } = props;

  return (
    <li className="dropdown-item dropdown-item--listTheater">
      {format("hh:mm", new Date(item))}
    </li>
  );
}

export default SelectMenuTimeItem;
